/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `transactiont_AFTER_INSERT` AFTER INSERT ON `transactiont` FOR EACH ROW BEGIN
	-- TOP UP Money
    CASE
    WHEN NEW.transactiontype=101 THEN
		INSERT INTO transactions (userid, amount, currency, transactiontype, remarks) SELECT userid, amount, currency, transactiontype, remarks FROM transactiont WHERE id = NEW.id; 
    -- SEND MONEY
    WHEN NEW.transactiontype=102 THEN
		INSERT INTO transactions (userid, fromto, amount, currency, transactiontype, remarks) SELECT userid, fromto, amount*-1, currency, transactiontype, remarks FROM transactiont WHERE id = NEW.id; 
        INSERT INTO transactions (userid, fromto, amount, currency, transactiontype, remarks) SELECT fromto, userid, amount, currency, 103, remarks FROM transactiont WHERE id = NEW.id; 
        -- to insert record into payee table if the recipient is not in payee list of user?
	-- RECEIVE MONEY
    WHEN NEW.transactiontype=103 THEN
		INSERT INTO transactions (userid, fromto, amount, currency, transactiontype, remarks) SELECT fromto, userid, amount, currency, 102, remarks FROM transactiont WHERE id = NEW.id; 
        INSERT INTO transactions (userid, fromto, amount, currency, transactiontype, remarks) SELECT userid, fromto, amount*-1, currency, transactiontype, remarks FROM transactiont WHERE id = NEW.id; 
    END CASE;
END */;;
DELIMITER ;
