  `country_code` varchar(3) NOT NULL COMMENT 'Country code for phone number',
  `mobile` varchar(16) NOT NULL,
  `role` varchar(10) NOT NULL COMMENT 'Member type',
  `dob_mth` int(2) DEFAULT '0',
  `dob_day` int(2) DEFAULT '0',
  `profilepix` longtext,
  `last_login` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
